import './Cabecalho_Editoras.css';

function Cabecalho_Editoras() {
  return (
    <div className="container centralizacao">
      <div className="row">
        <div className="col-lg-6 col-md-8 col-sm-10 mx-auto"> 
          <div className="flex-container-cabecalho">
            <div className="cabecalho">Editoras
            </div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Cabecalho_Editoras;
